import React from "react";
import emptypfp from "./images/emptypfp.png";
import "./home.css";
import { useNavigate, Navigate } from "react-router-dom";
import "./profile.css";
// When Logout is clicked
const Logout = (setCurrentPage) => {
  console.log("log");
  window.localStorage.removeItem("isLoggedIn");
  setCurrentPage = "";
  window.location.reload();
};

const Profile = (props) => {
  props.setCurrentPage("/profile");
  const stringifiedUser = window.localStorage.getItem("userInfo");
  const currentUser = JSON.parse(stringifiedUser);

  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserDetails = async () => {
      try {
        const response = await fetch(`http://localhost:3001/user/${currentUser}`);
        if (!response.ok) {
          throw new Error('Failed to fetch user details');
        }
        const userData = await response.json();
        setCurrentUser(userData.data);
        window.localStorage.setItem("userInfo", JSON.stringify(userData.data));
      } catch (error) {
        console.error("Error fetching user data:", error);
        // Optionally handle error state here
      }
    };

    fetchUserDetails();
  }, []); // Runs only once after the initial rendering

  return (
    <>
      <div className="home-app">
        <h1 className="home-title">RENTGMU</h1>
        <div className="topnav">
          <a href="#home" onClick={() => navigate("/home")}>
            Home
          </a>
          <a href="#contact" onClick={() => navigate("/contact")}>
            Contact
          </a>
          <a href="#about" onClick={() => navigate("/about")}>
            About
          </a>
          <a
            href="#MyProfile"
            onClick={() => navigate("/profile")}
            className="active"
          >
            My Profile
          </a>

          <a href="#logout" onClick={() => Logout(props.setCurrentPage)}>
            Logout
          </a>
        </div>
        <div className="profile-container">
          <img
            src={emptypfp}
            width={200}
            height={200}
            alt=""
            className="profile-image"
          />
          <div className="profile-name">
            <h1>{currentUser.name}</h1>
          </div>
          <div className="profile-contact-info">
            <p>Email Address: {currentUser.username}</p>
            {/* <p>Listings: </p> */}
          </div>
        </div>
      </div>
    </>
  );
};

export default Profile;
